import numpy as np

def createSparseMatrix(N=10, percentEmpty=0.50):
    nonEmptyElements = int((N*N)*(1-percentEmpty))
    #Start off by making this identity.
    matrix = np.eye(N)
    nonEmptyElements -= N
    #Generate random points and increment elements in matrix
    for _ in range(nonEmptyElements):
        point = (np.random.randint(low = 0, high = N-1, size=(2,1)))
        matrix[point[0],point[1]] += 1
    #Normalize rows
    row_sums = matrix.sum(axis=1)
    matrix = matrix / row_sums[:, np.newaxis]
    return matrix

